import React, { Component } from "react";

class Time extends Component {
  constructor() {
    super();
    this.state = {
      time: null
    };
  }

  getTime = () => {
    const timee = new Date().toLocaleTimeString();
    this.setState({
      time: timee
    });
  };

  componentDidMount() {
    this.getTime();
  }
  render() {
    return (
      <div>
        <h1>{this.state.time}</h1>
      </div>
    );
  }
}

export default Time;
